import { BrowserRouter , Routes, Route} from 'react-router-dom';
import Home from './pages/Home.js'
import HelloWorld from './pages/HelloWorld.js'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="pages">
          <Routes>
            <Route
            path = ""
            element = {<Home/>}
            />
            <Route
            path = "/helloworld"
            element = {<HelloWorld course="Coding"/>}
            />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
